import React from 'react';
import Title from './Components/Title';
import {IInventory} from './Components/Segment';
import Segments from './Components/Segments';
import './App.css';
import SearchForm from './Components/SearchForm';



const scheduledDelivery: IInventory[] = [
  {date: new Date(2022, 7, 8), quantity: 39},
  {date: new Date("9-july-2022"), quantity: 10},
  {date: new Date("10-july-2022"), quantity: 0},
  {date: new Date("11-july-2022"), quantity: 31},
  {date: new Date("12-july-2022"), quantity: 9},
  {date: new Date("13-july-2022"), quantity: 500},
  {date: new Date("14-july-2022"), quantity: 74}
];

function App() {
  return (
    <div className="App">
     <Title />
     <Segments data={scheduledDelivery}/>
     <SearchForm />

    </div>
  );
}

export default App;
